Sample Prompt:
Example_1:
input: ['a', 'a', 'a', 'a', 'a', '.', '.', '.', '.']
output: ['.', 'a', 'a', 'a', 'a', 'a', '.', '.', '.']

Example_2:
input: ['g', 'g', 'g', 'g', '.', '.', '.', '.', '.']
output: ['.', 'g', 'g', 'g', 'g', '.', '.', '.', '.']

Example_3:
input: ['b', 'b', 'b', '.', '.', '.', '.', '.', '.']
output: ['.', 'b', 'b', 'b', '.', '.', '.', '.', '.']

Test case:
input: ['.', 'g', 'g', 'g', '.', '.', '.', '.', '.']

###########################################################
Sample Outputs:
output: ['.', '.', 'g', 'g', 'g', '.', '.', '.', '.']
*/

public class Solution {
    public String move(String s) {
        if (s == null || s.length() <= 1) return s;
        char[] arr = s.toCharArray();
        int i = 0, j = 0;
        while (i < arr.length && j < arr.length) {
            if (arr[j]!= '.') {
                swap(arr, i++, j);
            }
            j++;
        }
        return new String(arr);
    }

    private void swap(char[] arr, int a, int b) {
        char tmp = arr[a];
        arr[a] = arr[b];
        arr[b] = tmp;
    }
}
